import "./navbar.css";
import { Route } from "react-router-dom";

const Home = () => <h1>Home</h1>;
const Signin = () => <h1>Signin</h1>;

const navbar = () => {
  return (
    <div>
      <div className="row">
        <div className="col">
          <span>Home</span>
        </div>
        <div className="col">
          <span>Signin</span>
        </div>
      </div>
    </div>
  );
};

export default navbar;
